import { render } from "react-dom";
import React from "react";

import AuthorQuiz from "./AuthorQuiz.js";

import "./bootstrap.min.css";

const authors = [
      {
            name:'Stephen King',
            imageUrl: 'img/stephen_king.jpg',
            books:['The Shining']
      },
      {
            name:'George R. R. Martin',
            imageUrl: './img/',
            books:['A Game of Thrones']
      },
      {
            name:'Mary Shelley',
            imageUrl: './img/',
            books:['Frankenstein']
      },
      {
            name:'Meditations',
            imageUrl: './img/',
            books:['Marcus Aurelius']
      },
]

const state = {
      turnData:{
            author: authors[0],
            books: authors[0].books
      }
}

render(<AuthorQuiz {...state} />, document.querySelector("#root"));
